import GranimCanvas from "./GranimCanvas"

const layoutStyle = {
  marginLeft: auto,
  marginRight: auto,
  textAlign: center,
  padding: 20,
}



const Layout = props => (
  <div ><style jsx>{`
  li {
    list-style: none;
    margin: 5px 0;
  }

  a {
    text-decoration: none;
    color: blue;
    font-family: 'Arial';
  }

  a:hover {
    opacity: 0.6;
  }
`}</style>
    <GranimCanvas/>
    <Header />
    {props.children}
  </div>
)

export default Layout
